public service announcement: 
as of this moment the benet embry show in showing utter and complete support for the #metoo and #muterkelly movements refuse to play music, promote venues, concerts or support in any shape form or fashion with the person known as robert sylvester kelly known by the stage name r kelly and/or any business(s) he is officially attached or connected to. also the benet embry show further demands all stations we are syndicated or afflicated with to do the same. the benet embry show will not accept any type of sponsonships, patronage, subsidy, funding, or financing with any person(s), associated with r. kelly. we at the benet embry show deeply and whole heartly deplore all the actions of r. kelly and him as a person. he is a disgrace to all men (specifically black men) around the world and humanity in general. the benet embry show encourages all manners of law enforcement to investigate, arrest and prosecute robert sylvester kelly for his crimes and safely return those young ladies home to their families. if anybody has information regarding where these young ladies are being held hostage or anything that will assist in r.kelly's arrest please contact your local law enforcement immediately. 
#thebenetembryshow

